Description
Ania Kinski, Nora Luxia, Tony Caliano, Tony Carrera, Rico Simmons, Kelly Doll, Rodolphe Antrim

Apres la mort de son mari, Ania reprend les renes de la societe dont elle a herite. Son physique de bourgeoise tres salope ne laisse pas indifferent l'ensemble de ses employes. De jalousie en sodomie, de competition en fellation, cette parodie pornographique vous donnera la solution pour baiser votre patronne.

